import Popup from "reactjs-popup";
import "./signIn.css";

export default function Signin() {
  return (
    <div className="button-component">
      <div className="button-signin">
        <Popup
          trigger={<button className="signin"> sign in</button>}
          position="bottom"
          modal
          nested
        >
          {(close) => (
            <div className="modal">
              <button className="close" onClick={close}>
                &times;
              </button>
              <div className="header"> Sign in </div>
              <div className="content">
               <button className="google-button">
                    Google
               </button>
              </div>
              <div className="actions">
                <Popup
                  trigger={<button className="button"> Trigger </button>}
                  position="top center"
                  nested
                >
                  <span>
                    Lorem ipsum dolor sit amet, consectetur adipisicing elit.
                    Beatae magni omnis delectus nemo, maxime molestiae dolorem
                    numquam mollitia, voluptate ea, accusamus excepturi deleniti
                    ratione sapiente! Laudantium, aperiam doloribus. Odit, aut.
                  </span>
                </Popup>
                <button
                  className="button"
                  onClick={() => {
                    console.log("modal closed ");
                    close();
                  }}
                >
                  close modal
                </button>
              </div>
            </div>
          )}
        </Popup>
      </div>
    </div>
  );
}
